import React from 'react';
import '../styles/Competences.scss'; // Importation du fichier de styles

const Competences = () => {
  return (
    <div className="competences-container">
      <h2>Mes Compétences</h2>
      
      {/* Ajout de la roue de compétences */}
      <div className="skills-wheel">
        <div className="skill html">HTML</div>
        <div className="skill css">CSS</div>
        <div className="skill sass">Sass</div>
        <div className="skill javascript">JavaScript</div>
        <div className="skill react">React</div>
        <div className="skill node">Node.js</div>
        <div className="skill git">Git</div>
        <div className="skill design">Design</div>
      </div>
    </div>
  );
};

export default Competences;
